import React from 'react';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';

import Routing from "./Routing";

function App() {
  return (
    <div>
      <Header />
          <div><h2>Hello</h2></div>
        <Routing />
      <Footer />
    </div>
  );
}

export default App;
